import React, { useState, useRef } from 'react';
import { startScanner } from '../utils/scanner';

export default function Scanner() {
  const [symbolsText, setSymbolsText] = useState('BTCUSDT,ETHUSDT');
  const [delayMs, setDelayMs] = useState(500);
  const [running, setRunning] = useState(false);
  const [results, setResults] = useState([]);
  const controllerRef = useRef(null);

  function addResult(r) {
    setResults((s) => {
      const next = [r, ...s].slice(0, 200);
      return next;
    });
  }

  function handleStart() {
    const symbols = (symbolsText || '').split(',').map((s) => s.trim()).filter(Boolean);
    setResults([]);
    setRunning(true);
    const ctrl = startScanner(symbols, { delayMs: Number(delayMs) || 500 }, (res) => {
      addResult(res);
    });
    controllerRef.current = ctrl;
  }

  function handleStop() {
    try { controllerRef.current && controllerRef.current.stop(); } catch (e) {}
    controllerRef.current = null;
    setRunning(false);
  }

  return (
    <div className="card" style={{marginBottom: 12}}>
      <div className="header">
        <div className="title">Symbol Scanner</div>
      </div>
      <div style={{padding: 12}}>
        <div style={{display: 'flex', gap: 8, alignItems: 'center', marginBottom: 8}}>
          <input style={{flex:1}} value={symbolsText} onChange={(e) => setSymbolsText(e.target.value)} />
          <input style={{width:100}} value={delayMs} onChange={(e) => setDelayMs(e.target.value)} />
          {!running ? (
            <button onClick={handleStart}>Start</button>
          ) : (
            <button onClick={handleStop}>Stop</button>
          )}
        </div>

  <div style={{fontSize: '0.9rem', color: '#666', marginBottom: 8}}>Delay per request (ms) - keep this &gt;= 300 to avoid API limits</div>

        <div style={{maxHeight: 240, overflow: 'auto', borderTop: '1px solid #eee', paddingTop:8}}>
          <table style={{width:'100%', borderCollapse: 'collapse'}}>
            <thead>
              <tr style={{textAlign:'left'}}>
                <th>Symbol</th><th>Crossed</th><th>Direction</th><th>Price</th><th>When</th><th>Error</th>
              </tr>
            </thead>
            <tbody>
              {results.map((r, idx) => (
                <tr key={idx} style={{borderTop: '1px solid #f2f2f2'}}>
                  <td>{r.symbol}</td>
                  <td>{r.crossed ? 'YES' : '—'}</td>
                  <td>{r.direction || '—'}</td>
                  <td>{typeof r.price !== 'undefined' ? r.price : '—'}</td>
                  <td style={{fontSize:'0.8rem'}}>{r.when || '—'}</td>
                  <td style={{color:'crimson'}}>{r.error || ''}</td>
                </tr>
              ))}
            </tbody>
          </table>
        </div>
      </div>
    </div>
  );
}
